import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function LovacData() {
    const navigate = useNavigate();
    const [lovci, setLovci] = useState([]);

    // Fetch data from the backend when the component mounts
    useEffect(() => {
        axios.get('/lovac/1') // Assume you're fetching data for 'lovac' with ID 1
            .then(response => {
                if (response.data.error) {
                    alert(response.data.message);
                } else {
                    setLovci([response.data.data]);
                }
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    // Navigate to the input form
    const handleButtonClick = () => {
        navigate('/unos-lovca');
    };

    // Styles
    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        color: 'white',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
    };

    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <button onClick={handleButtonClick} style={buttonStyle}>
                Unesi lovca
            </button>
            <table style={{ marginTop: '20px', borderCollapse: 'collapse', width: '80%' }}>
                <thead>
                    <tr>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Ime</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Prezime</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Adresa</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Datum rođenja</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Kontakt</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Korisničko ime</th>
                        <th style={{ border: '1px solid black', padding: '8px', textAlign: 'left' }}>Uloga</th>
                    </tr>
                </thead>
                <tbody>
                    {lovci.map(lovac => (
                        <tr key={lovac.korisnicko_ime}>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.ime}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.prezime}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.adresa}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.datum_rodjenja}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.kontakt}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.korisnicko_ime}</td>
                            <td style={{ border: '1px solid black', padding: '8px' }}>{lovac.uloga}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default LovacData;
